import React from 'react';


function Projects() {
return (
	<div className="container-fluid">
	
	
		<h1>
		Projects
		</h1>
		
		<h3>
		This Website
		</h3>
		
		<p>
		I Created this website from scratch in Javascript. I used React, Gulp, Sass, and Bootstrap in the process of creating this website. Additionally, I familiarized myself with Github and Github pages in order to host this page online.
		</p>
		
		<h3>
		School Projects
		</h3>
		
		<p>
		At OSU, I have completed many projects for my Computer Science class. One of these projects was an implementation of a Java Class to represent all Natural Numbers using String as the data representation.
		</p>
		
		
		
		
	</div>
);
}

export default Projects;
